    data: |
      SELECT col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col1 + + + col0 * - - ( col0 ) NOT BETWEEN NULL AND - col1 / - col2 * + col0;
  - name: tab2

outputs:
  - name: q12685.out
    data: |
